import "../../styles.css";

export const Register = () => {
  return (
    <>
      <div className="cont-fluid">
        <input type="text" placeholder="Name" />
        <input type="text" placeholder="Username" />
        <input type="password" placeholder="Password" />
      </div>
    </>
  );
};
